【特徴】<BR>
●ホエイプロテイン100％使用<BR>
・たんぱく原料として、吸収の良い「ホエイプロテイン」を100％使用。<BR>
・トレーニング直後などのプロテイン摂取ポイントに合わせてたんぱく質を補給するので、理想的なカラダづくりをサポート。<BR>
●「7種のビタミンＢ群＋ビタミンＣ」配合<BR>
・カラダづくりに欠かせない「７種のビタミンＢ群」、体調維持に欠かせない「ビタミンＣ」を配合。<BR>

◎「ザバス　ホエイプロテイン１００」は、1日2回（約42g）を目安にお飲みいただくことで、アスリートが1日に必要とする7種のビタミンＢ群、Ｃの不足分を補えるよう設計されています。<BR>
（ザバス　スポーツ＆ニュートリション・ラボが実施したアスリートの食事調査からの算出結果より）<BR>

●召しあがり方<BR>
牛乳または水200から300mlに、付属のスプーン3杯（約21g）を溶かしてお飲みください。<BR>
※量はお好みに応じて調整してください。<BR>
※運動後がおすすめです。<BR>
◎プロテインシェイカー（別売り）を使用すると溶けやすく手軽にプロテインを摂取できます。<BR>

●主要栄養成分<BR>
［1食分（21g）当たり］（明治社分析値）<BR>
エネルギー・・83kcal、たんぱく質・・15.0g、脂質・・1.3g、炭水化物・・2.7g、ナトリウム・・100mg<BR>
ビタミンB1・・0.87mg、ビタミンB2・・0.93mg、ナイアシン・・6.3mg、ビタミンB6・・0.64mg、葉酸・・84-220μg、ビタミンB12・・0.8-3.1μg、パントテン酸・・0.62mg、ビタミンＣ・・88mg<BR>
●タンパク含量75％（製品無水物あたり）<BR>
●アミノ酸スコア１００<BR>


<br>
