●「大豆プロテイン＋ガルシニアエキス」配合<BR>
・たんぱく原料として引き締まったカラダづくりをサポートする「大豆プロテイン」を配合。<BR>
・さらに「ガルシニアエキス」をバランスよく配合。<BR>
●「11種のビタミン＋3種のミネラル」配合<BR>
・減量時に不足しやすく、カラダづくりに欠かせない「11種のビタミン」と、汗で失われがちなカルシウム・鉄・マグネシウムを配合。<BR>
<BR><BR>
◎「ザバス　ウェイトダウン」は、1日2回（約42g）を目安にお召し上がりいただくことで、アスリートが1日に必要とする11
種のビタミン、3種のミネラルの不足分を補えるよう設計されています。<BR>
（ザバス　スポーツ＆ニュートリション・ラボが実施したアスリートの食事調査からの算出結果より）<BR><BR>

●原材料名<BR>
脱脂大豆たんぱく、デキストリン、食塩、ガルシニアエキス、植物油脂、貝Ca、V.C、酸化Mg、香料、乳化剤、甘味料（アスパルテーム・L-フェニルアラニン化合物、スクラロース、アセスルファムK）、ピロリン酸第二鉄、ナイアシン、V.E、V.B2、V.B1、V.B6、パントテン酸Ca、V.A、葉酸、V.D、V.B12<BR>
▼本製品は小麦、卵、乳成分を含む製品と共通の設備で製造しています。<BR>
●主要栄養成分<BR>
［1食分（21g）当たり］（明治社分析値）<BR>
エネルギー・・79kcal、たんぱく質・・16.8g、脂質・・0.9g、炭水化物・・0.9g、ナトリウム・・93-220mg、<BR>
カルシウム・・192mg、鉄・・4.8mg、マグネシウム・・96mg、
ビタミンA・・157μg、ビタミンD・・2.2μg、ビタミンE・・1.5mg、ビタミンB1・・0.87mg、ビタミンB2・・0.93mg、ナイアシン・・5.8mg、ビタミンB6・・0.64mg、葉酸・・96μg、ビタミンB12・・0.2μg、パントテン酸・・0.62mg、ビタミンC・・88mg<BR>
●タンパク含量84.5％（製品無水物あたり）<BR>
●ガルシニアエキス・・116mg/1食分（21g）あたり<BR><style type="text/css">
