【特徴】<BR>
●スポーツ直後の飲みやすさを追求。<BR>
アクア製法によりプロテインの常識を変えるクリアでスッキリした飲み口を実現。たんぱく質摂取効率の高いスポーツ直後の飲みやすさを追及したスポーツドリンク感覚の水分補給型プロテインです。<BR>
●吸収効率の高いホエイプロテインを使用<BR>
たんぱく原料として、通常のホエイプロテインより吸収効率が良い（明治社調べ）「ホエイプロテイン」を100％使用しています。吸収が良いので、プロテイン摂取ポイントに合わせて、効率的に補給することができます。<BR>
◎「ザバス　アクア　ホエイプロテイン１００」は、1日2から3回（約42g）を目安にお飲みいただくことで、アスリートが1日に必要とする7種のビタミンB群、ビタミンCの不足分を補えるよう設計されています。
（ザバス　スポーツ＆ニュートリション・ラボが実施したアスリートの食事調査結果より）<BR>
【原材料】<BR>
乳清たんぱく、乳糖、クエン酸、トレハロース、香料、V.C、甘味料（アセスルファムK、スクラロース）、乳化剤（大豆を含む）、酸味料、野菜色素、ナイアシン、V.B1、V.B2、パントテン酸Ca、V.B6、葉酸、V.B12
◆卵、小麦を含む製品と共通の設備で製造しています。
<BR>【主要栄養成分】<BR>
［1食分（21g）当たり］（明治社分析値）
エネルギー・・78kcal、たんぱく質・・14.1g、脂質・・0g、炭水化物・・5.8g、ナトリウム・・14mg、ビタミンB1・・2.0mg、ビタミンB2・・1.2mg、ナイアシン・・6.0mg、ビタミンB6・・0.50mg、葉酸・・33μg、ビタミンB12・・0.90μg、パントテン酸・・0.76mg、ビタミンＣ・・74mg、クエン酸・・1660mg
●タンパク含量70％（製品無水物あたり）


<br>
